fun destructurePolymer(str: String): String {
    var out = str

    var j = 1
    while (j < out.length) {
        val i = j - 1
        if (isPolymer(out[i], out[j])) {
            //out = out.substring(0, i) + out.substring(j + 1)
            out = out.replace("${out[i]}${out[j]}", "")
            j = 1
        } else {
            j++
        }
    }

    return out
}

fun removeUnits(str: String, unit: String): String {
    val out = str.replace(unit.toLowerCase(), "")
    return out.replace(unit.toUpperCase(), "")
}


fun findBestReaction(str: String): Int {
    val out = mutableListOf<Int>()
    for (c in 'A'..'Z') {
        out.add(destructurePolymer(removeUnits(str, c.toString())).length)
    }
    return out.min() ?: -1
}

fun isPolymer(char1: Char, char2: Char): Boolean {
    return char1.toUpperCase() == char2.toUpperCase() && char1 != char2
}

